import '../App.css';
import Skills from '../Components/Skills';
import Header from '../Components/Header';


class App extends Component {
    render() {
        return (
        <main>
          <div className="App">

            {/* ABOUT SECTION */}
            <div className='About'>
                  <div className='row'>
                  <img src='../Images/gretchpic.JPG' className="Gretchen-Image" alt="Gretchen headshot" />
                  <p>Full stack web developer leveraging experience in sales and customer service to build a better and more responsive user experience. Recently earned a professional certificate in full stack coding from Butler University, with recently developed skills in React, JavaScript, Css, and website responsiveness. Interested in expanding knowledge and experience to grow into a successful career in UX/UI design.</p>
                </div>
            </div>

            {/* PROJECTS SECTION */}
          <div className='Projects'>

          <Header
          header="FEATURED"
        />

        <Wrapper>
          <Portfolio
            key={projects[0].id}
            id={projects[0].id}
            picture={projects[0].image}
            name={projects[0].name}
            description={projects[0].description}
            tech={projects[0].tech}
            github={projects[0].github}
            site={projects[0].site}
          />

          <Portfolio
            key={projects[1].id}
            id={projects[1].id}
            picture={projects[1].image}
            name={projects[1].name}
            description={projects[1].description}
            tech={projects[1].tech}
            github={projects[1].github}
            site={projects[1].site}
          />
        </Wrapper>

            <div className="buttonWrapper">
              <button
                type="submit"
                id="portfolioButton"
                className="profile btn-lg"
                onClick={(event) => (window.location.href = "/portfolio")}
                >
                VIEW PORTFOLIO
                </button>
              </div>
            </div>

            {/* SKILLS SECTION */}
            <div className='Skills'>
              <Header
                header="SKILLS"
              />
              <Skills />
              </div>

          </div>
        </main>
        );
      }
      }
      export default App;
